"value":"$T_value_W"
},
"metaData":{
"connections":{
"active":{
"desc":"If set the slider periodically write boolean TRUE value to the datapoint when the slider is pressed or moving.",
"optional":true,
"order":"02",
"write":true
},
"disable_by":{
"desc":"If non-zero the component is disabled and data are no longer updated.",
"optional":true
},
"hide_by":{
"desc":"If non-zero the component is hidden.",
"optional":true
},
"refresh_from":{
"desc":"If set the state of the component is updated based on the value read from this datapoint. Otherwise the value from main datapoint is used.",
"optional":true,
"order":"03",
"prev":[
"value_R"
]
},
"value":{
"desc":"The main datapoint where numeric value is written.",
"order":"01",
"prev":[
"value_W"
],
"write":true
}
},
"decimals":{
"desc":"Round the number when read.",
"max":"6",
"min":"0",
"order":"08",
"type":"int"
},
"desc":"Slider sets integer or floating value to the target. The range of the slider is limited between the <code>min</code> and <code>max</code> value. Slider move is split to several <code>step</code>s. The <code>value</code> can be converted using <code>scale</code> and <code>offset</code> and rounded to chosen number of <code>decimals</code>. The <code>fontScale</code> applies to the displayed value. Each slider has a <code>label</code>.",
"fontScale":{
"desc":"The fontScale of the displayed value. If set to 1 the font size is default. The floating number above 1 increase the font size.",
"order":"05",
"type":"float"
},
"label":{
"desc":"The text description.",
"order":"04",
"type":"str"
},
"max":{
"desc":"The maximum slider value.",
"order":"02",
"type":"float"
},
"min":{
"desc":"The minimum slider value.",
"order":"01",
"type":"float"
},
"offset":{
"desc":"Offset the number when read. The equation is scale*val+offset. The number is converted back when written.",
"order":"07",
"type":"float"
},
"scale":{
"desc":"Scale the number when read. The equation is scale*val+offset. The number is converted back when written.",
"order":"06",
"type":"float"
},
"step":{
"desc":"The size of step (increment) when slider moves.",
"order":"03",
"type":"float"
},
"writeOnChange":{
"desc":"If true the value is written to the target when the slider is moving.",
"order":"09",
"type":"bool"
}
},
"options":{
"decimals":0,
"fontScale":1,
"label":"Q1 delay [hundredths of second]",
"max":"100",
"min":"0",
"offset":0,
"scale":1,
"step":10,
"writeOnChange":"False"
}
}

